import React from 'react';

class Fish extends React.Component {
    render() {
        const { image, name, price, desc, status } = this.props.details; // name = this.props.details.name & image = this.props.details.image
        return (
            <li className="menu-fish">
                <img src={image} alt={name} />
                <h3 className="fish-name">
                    {name}
                </h3>
            </li>
        );
    };
}

export default Fish;
